import React, { Component } from 'react';
import logo from './logo.svg';
import Form from "react-jsonschema-form";
import {Button,Navbar,Tabs,Tab} from "react-bootstrap";

//import './App.css';
import Empl from  './components/employee_details'
class App extends Component {
  render() {
    return (

      <div className="App">
        <Navbar fixedTop = 'true' bsStyle = 'inverse' >
        <Tabs defaultActiveKey={2} id="uncontrolled-tab-example">
          <Tab eventKey={1} title  = "TAB_1">
            <Empl />
            </Tab>
          <Tab eventKey={2} title  = "TAB_2">TAB 2</Tab>
          <Tab eventKey={3} title = "TAB_3">TAB 3</Tab>
          <Tab eventKey={4}  title  = "TAB_4">TAB 4</Tab>
        </Tabs>
        </Navbar>
      </div>
    );
  }
}

export default App;
